/** @format */
import React, { Fragment, } from "react";
import Table from "react-bootstrap/Table";
import Button from "react-bootstrap/Button";
import "../components/main.css";
const VideosList = () => {

    return (
        <div>
            <Table className="table table-striped">
                <thead>
                    <tr>
                        <th className="text-left" style={{ backgroundColor: "#67726A" }}>Video Title</th>
                    </tr>
                </thead>
                <tbody>
                    <tr>
                        <td style={{ textAlign: "left" }}>
                            <text>videoName</text>
                            <text style={{ marginLeft: "1000px" }}>Delete</text>
                            <text style={{ marginLeft: "50px" }}>Update</text>
                        </td>
                    </tr>
                </tbody>
            </Table>
        </div>
    );
}
export default VideosList
